      </div>
  )
}
const CustomerProfile = (props) => {
  return (
      <div>
          <h2>{props.name}({props.id})</h2>
          <img src={props.image}></img>

    </div>
  )
}
const CustomerInfo = (props) => {
  return (
      <div>
          <p>{props.birthday}</p>
          <p>{props.gender}</p>
          <p>{props.job}</p>
      </div>
  )
}
